If you‚Äôre fully committed to your goals that means you‚Äôre actively taking the steps towards them. You‚Äôre weeding out everything that hasn‚Äôt been and isn‚Äôt pushing you and you‚Äôre actually getting focused. You‚Äôre not making excuses like; I don‚Äôt have the time right now, I don‚Äôt have the money, I‚Äôve got too many things going on, etc. No, you‚Äôre saying ‚Äúthis is my goal and I don‚Äôt care what stands in my way, I‚Äôm getting it!‚Äù I could‚Äôve easily said I have too much going on and used that excuse to stop me from choosing my health over everything else. I‚Äôm working full time and staying home with my newborn...I‚Äôm the definition of strapped for time people ü§£ But you know what, I‚Äôm choosing my health for my family over all else. 

If you‚Äôre just interested in your goals you‚Äôre fooling yourself and those around you. You‚Äôre playing games. You‚Äôre wasting time. 

If you want that promotion, work for it! Don‚Äôt just say ‚Äúman, I really want to get promoted‚Äù, actually put in the work to *earn* it! If you want to lose weight you need to actually work for it. This involves eating healthy and working your body, not just wishing to lose weight. 

Stop wasting your time hoping for things to change and be the driving force to MAKE them change! 
